      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/token/ERC721/utils/ERC721HolderUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import "erc721a/contracts/IERC721A.sol";

contract StakingUpgradable is
    Initializable,
    OwnableUpgradeable,
    ERC721HolderUpgradeable,
    PausableUpgradeable,
    ReentrancyGuardUpgradeable
{
    IERC721A public token;
    mapping(uint256 => address) public tokenOwners;

    event TokenStaked(
        address indexed account,
        uint256 id,
        uint256 timestamp
    );

    event TokenWithdrawn(address indexed account, uint256 id);

    function initialize(address tokenAddress_) external initializer {
        __Ownable_init_unchained();
        __ERC721Holder_init_unchained();
        __Pausable_init_unchained();
        __ReentrancyGuard_init_unchained();
        _pause();
        token = IERC721A(tokenAddress_);
    }

    function stake(
        uint256[] calldata tokenIds
    ) external nonReentrant whenNotPaused {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            uint256 tokenId = tokenIds[i];
            tokenOwners[tokenId] = msg.sender;
            token.transferFrom(msg.sender, address(this), tokenId);

            emit TokenStaked(
                msg.sender,
                tokenId,
                block.timestamp
            );
        }
    }

    function withdraw(
        uint256[] calldata tokenIds
    ) external nonReentrant whenNotPaused {
        for (uint256 i = 0; i < tokenIds.length; i++) {
            uint256 tokenId = tokenIds[i];
            require(tokenOwners[tokenId] == msg.sender, "Invalid owner");
            delete tokenOwners[tokenId];
            token.safeTransferFrom(address(this), msg.sender, tokenId);

            emit TokenWithdrawn(msg.sender, tokenId);
        }
    }

    function setToken(address tokenAddress_) public onlyOwner {
        token = IERC721A(tokenAddress_);
    }

    function pause() external onlyOwner {
        _pause();
    }

    function unpause() external onlyOwner {
        _unpause();
    }
}
